import React, { Component, Img } from 'react';
import {
  BrowserRouter as Router,
  Route,
  Link,
  Switch,
  Redirect
} from 'react-router-dom';
import { Card, Badge, Row, Col } from 'antd';
// partials
import Calender from './partials/Calendar';

// css
import './App.css';
import 'antd/dist/antd.css';

class App extends Component {
  constructor (breaks) {
  }
  tripleCard () {
    let items = [
      'Add Item', 'Delete Item',
      'Misc.'
    ];
    let cards = items.map(
        (item) =>
          <Col span={8}>
          <Card hoverable style={{display: "block", width: 240}}>
          {item} </Card>
          </Col>
        )
    return cards;
  }
  render() {
    return (
      <div className="App">
        <Row>
          {this.tripleCard()}
        </Row>
        <Calender/>
      </div>
    );
  }
}

export default App;
